import React from 'react'
import { FaShoppingBag } from "react-icons/fa";

export default function Header() {
  return (
    <header>
        <div>
            <span className='logo'>Lesshop</span>
            {<ul className='nav'>
              <li>Про нас</li>
              <li>Контакты</li>
              <li>Кабинет</li>
            </ul>}
            <FaShoppingBag className='shop-cart-button'/>
        </div>
        <div className='presentation'></div>
    </header>
  )
}
